import React from 'react';
import './LeftBar.css';
import IconoAdmin from '../images/iconos/Icono_Admin.png';
import IconoProductos from '../images/iconos/Icono_Productos.png';
import IconoRoles from '../images/iconos/Icono_Roles.png';
import IconoVentas from '../images/iconos/Icono_Ventas.png';
import { Link } from 'react-router-dom'
import { ImStatsDots, ImUsers } from "react-icons/im";
import { FaBoxes, FaTools } from "react-icons/fa";

const LeftBar = () => {

    return (
        <aside id="left" className="">
            <div className="icon">
                <Link to='/app/roles'><FaTools style={{ color: 'white' }} /></Link>
            </div>

            <div className="icon">
                <Link to='/app/stock'><FaBoxes style={{ color: 'white' }} /></Link>
            </div>
            <div className="icon">
                <Link to='/app/ventas'><ImStatsDots  style={{ color: 'white' }} /></Link>

            </div>
            <div className="icon">
                <Link to='/app/roles'><ImUsers  style={{ color: 'white' }} /></Link>
            </div>
        </aside>
    );
}

export default LeftBar;
